import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'
import { routes } from './routes'
import 'bootstrap'; import 'bootstrap/dist/css/bootstrap.min.css';

Vue.use(VueRouter)

Vue.config.productionTip = false

const vueRouter = new VueRouter({
  mode: 'history',
  routes
  });

  new Vue({

  el: '#app',

  router: vueRouter,

  render: h => h(App)

  });
